            <p class=""card-text"">
                My name is Herman Samra and I am a Junior Software Developer.
            </p>
            <p class=""card-text"">
                I have recently completed my BSc. In Computer Science at the University of British Columbia (May 2019). During my time there, I took coursework in databases, artificial intelligence, machine learning, and computer vision. Outside of classes, I served as Councillor for the Science Undergraduate Society and was elected by my peers to be the student representative for the department of Computer Science.");
                WriteLiteral(@"
            </p>
            <p class=""card-text"">
                In addition to school related activities, I spent some time working with Black Boys Code to help young children get a head start in the tech sector.  I teamed up with one of peers and was responsible for organizing and administering hack-a-thons from children between the age of 5 and 17. Organizing entailed creating a programming challenge that 5-year-old children could participate in, but one that would not bore 17-year-old students. We able to achieve this by creating a series of challenges with the Sphero robot. On the day of the events, I gave a detailed presentation on the basics of programming, this included: booleans, conditionals, loops, and some niche Sphero functions. Afterwards, I had the opportunity to assist teams and help make their visions a reality.
            </p>
            <p class=""card-text"">
                When I’m not involved with school or other programming endeavours, I like to enjoy the outdoors. Growing up ");
                WriteLiteral(@"in Vancouver, I have learned to enjoy the beautiful hikes, plentiful bodies of water, and the immersive city landscape. Being Vancouver, we only get a few sunny months each year, so I’ve taken up running to fill the rest of the year. In the past, I have participated in 10km long charity runs, such as the Sun Run, Turkey Trot, and Chilly Chase. I’m currently training for my first half marathon for later in 2019, and hopefully my first marathon sometime in 2020!
            </p>
            <p class=""card-text"">
                You can learn more about me by visiting my <a href=""https://github.com/h-samra"">GitHub</a> and <a href=""https://www.linkedin.com/in/hermansamra"">LinkedIn</a> pages, or contact me by <a href=""mailto:herman.samra1@gmail.com"">email</a> for any inquiries.
            </p>
